    false,nt"url": null,nt"notes": "In 1984, the U.S. Geological Survey (USGS),
    Office of Marine Geology, launched a program using the Geological LOng-Range Inclined
    Asdic (GLORIA) sidescan-sonar system to study the entire U.S. Exclusive Economic
    Zone (EEZ). From 1988 through 1991, the USGS and IOS (Institute of Oceanographic
    Sciences, U.K.) scientists conducted several surveys within the U.S. EEZ off Hawaii.
    Nine surveys during that time period focused on the central Hawaii region. The results
    of these surveys were 24 digital mosaics of approximately a 2 degree by 2 degree
    area with a 50-meter pixel resolution.",nt"license_title": null,nt"extras":
